import Offcanvas from 'react-bootstrap/Offcanvas';

interface propData {
  show: boolean;
  handleClose: () => void;
  modalData: any;
  id: any;
}

const AddEditUser = (props: propData) => {
  return (
    <Offcanvas show={props.show} onHide={props.handleClose} placement="start">
      <Offcanvas.Header closeButton>
        <Offcanvas.Title>Add or Edit User</Offcanvas.Title>
      </Offcanvas.Header>
      <Offcanvas.Body>
        <p>This is the Offcanvas body content.</p>
        <button className="btn btn-secondary" onClick={props.handleClose}>
          Close
        </button>
      </Offcanvas.Body>
    </Offcanvas>
  );
};

export default AddEditUser;
